import { useState, useEffect, useMemo, useCallback, memo } from 'react';
import PropTypes from 'prop-types';
import './styles.css';

// ==================== CONSTANTS ====================
const PHONE_REGEX = /\b([3689]\d{3})[ -]?(\d{4})\b/g;

// ==================== COMPONENTS ====================

/**
 * PhoneNumber - Click to reveal phone number
 */
const PhoneNumber = memo(({ number }) => {
  const [isRevealed, setIsRevealed] = useState(false);
  
  if (!number) return null;
  
  const digits = number.replace(/\D/g, '');
  const display = isRevealed 
    ? digits.replace(/(\d{4})(\d{4})/, '$1 $2')
    : `${digits.slice(0, 4)} XXXX`;

  const handleKeyDown = (e) => {
    if (e.key === 'Enter' || e.key === ' ') {
      e.preventDefault();
      setIsRevealed(true);
    }
  };

  return (
    <span 
      className="phone-number"
      onClick={() => setIsRevealed(true)}
      onKeyDown={handleKeyDown}
      role="button"
      tabIndex={0}
      style={{ 
        cursor: isRevealed ? 'default' : 'pointer',
        color: isRevealed ? 'inherit' : '#2563EB'
      }}
    >
      {display}
    </span>
  );
});

PhoneNumber.displayName = 'PhoneNumber';
PhoneNumber.propTypes = {
  number: PropTypes.string
};

/**
 * Parse text and replace phone numbers with clickable components
 */
const parsePhoneNumbers = (text) => {
  if (!text) return [];
  
  PHONE_REGEX.lastIndex = 0;
  const parts = [];
  let lastIndex = 0;
  let match;

  while ((match = PHONE_REGEX.exec(text)) !== null) {
    if (match.index > lastIndex) {
      parts.push(text.slice(lastIndex, match.index));
    }
    parts.push(<PhoneNumber key={match.index} number={match[0]} />);
    lastIndex = match.index + match[0].length;
  }
  
  if (lastIndex < text.length) {
    parts.push(text.slice(lastIndex));
  }
  
  return parts;
};

/**
 * ImageGallery - Image display with navigation
 */
const ImageGallery = memo(({ pic, title, flag, arrowLeft, arrowRight }) => (
  <div className="imageContainer">
    {flag && <img className="flag" src={flag} alt="Featured" />}
    <img className="mainPic" src={pic} alt={title} />
    
    <button className="arrowBtn arrowLeft" aria-label="Previous">
      <img src={arrowLeft} alt="" />
    </button>
    <button className="arrowBtn arrowRight" aria-label="Next">
      <img src={arrowRight} alt="" />
    </button>
  </div>
));

ImageGallery.displayName = 'ImageGallery';
ImageGallery.propTypes = {
  pic: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  flag: PropTypes.string,
  arrowLeft: PropTypes.string.isRequired,
  arrowRight: PropTypes.string.isRequired
};

/**
 * Description - Property description with phone parsing
 */
const Description = memo(({ text, isVisible }) => {
  const lines = useMemo(() => 
    String(text || '')
      .replace(/\r\n?/g, '\n')
      .split('\n')
      .filter(line => line.trim()),
    [text]
  );
  
  return (
    <div className={`descriptionSection ${isVisible ? 'visible' : ''}`}>
      <div className="description">
        {lines.map((line, i) => (
          <p key={i} className="descriptionText">
            {parsePhoneNumbers(line)}
          </p>
        ))}
      </div>
    </div>
  );
});

Description.displayName = 'Description';
Description.propTypes = {
  text: PropTypes.string,
  isVisible: PropTypes.bool.isRequired
};

// ==================== MAIN COMPONENT ====================

/**
 * ListingAd - Property listing card component
 */
function ListingAd({
  flag,
  arrow_left,
  arrow_right,
  price,
  icon,
  pic,
  title,
  address,
  description,
  availabilities_label,
  subprice_label,
  project_type,
  year,
  ownership_type
}) {
  const [isDescriptionVisible, setIsDescriptionVisible] = useState(false);
  const [shouldHide, setShouldHide] = useState(false);
  
  // SEO: Show description initially, hide after mount
  useEffect(() => {
    setShouldHide(true);
  }, []);
  
  const toggleDescription = useCallback(() => {
    setIsDescriptionVisible(prev => !prev);
  }, []);
  
  const showDescription = !shouldHide || isDescriptionVisible;

  return (
    <div className="App">
      <ImageGallery 
        pic={pic}
        title={title}
        flag={flag}
        arrowLeft={arrow_left}
        arrowRight={arrow_right}
      />
      
      <div className="mainContent">
        {/* Property Info & Price */}
        <div className="topContent">
          <div className="leftContent">
            <div className="leftTopContent">
              <img className="icon" src={icon} alt="" aria-hidden="true" />
              <div className="textLeftTopContent">
                <h1 className="title">{title}</h1>
                <p className="address">{address}</p>
              </div>
            </div>
            
            <div className="leftBotContent">
              <p className="labelTop">{project_type} · {year} · {ownership_type}</p>
              <p className="labelBot">{availabilities_label}</p>
            </div>
          </div>

          <div className="rightContent">
            <div className="price">
              <h1>{price}</h1>
            </div>
            <p className="priceFrom">{subprice_label}</p>
          </div>
        </div>

        {/* Description */}
        <Description text={description} isVisible={showDescription} />

        {/* Toggle Button */}
        <div className="bottomContent">
          <button 
            onClick={toggleDescription}
            aria-expanded={isDescriptionVisible}
          >
            {isDescriptionVisible ? 'Hide description' : 'See description'}
          </button>
        </div>
      </div>
    </div>
  );
}

ListingAd.propTypes = {
  flag: PropTypes.string,
  arrow_left: PropTypes.string.isRequired,
  arrow_right: PropTypes.string.isRequired,
  price: PropTypes.string.isRequired,
  icon: PropTypes.string.isRequired,
  pic: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  address: PropTypes.string.isRequired,
  description: PropTypes.string,
  availabilities_label: PropTypes.string.isRequired,
  subprice_label: PropTypes.string.isRequired,
  project_type: PropTypes.string.isRequired,
  year: PropTypes.oneOfType([PropTypes.string, PropTypes.number]).isRequired,
  ownership_type: PropTypes.string.isRequired
};

ListingAd.defaultProps = {
  flag: null,
  description: ''
};

export default ListingAd;
